import React from 'react';
import './App.css';
import BettingOdds2024 from './components/BettingOdds2024';
import StateSearch from './components/StateSearch';
import VotingMap from "./components/VotingMap";

function App() {
  return (
    <div className="App">
      <h1 className="title">U.S. Presidential Election Data Visualization</h1>
      
      <div className="tab-container">
        <button className="tab-button">Google Earth Map</button>
        <button className="tab-button">Betting Odds</button>
        <button className="tab-button">Polling Data</button>
      </div>

      <div className="sections-container">
        <section className="section">
          <h2>Google Earth Map</h2>
          <p>View satellite images of specific counties or locations</p>
          <StateSearch />
        </section>
        
        <section className="section">
          <h2>Voting Map</h2>
          <VotingMap />
        </section>

        <section className="section">
          <h2>Betting Odds</h2>
          <BettingOdds2024 />
        </section>
      </div>
    </div>
  );
}

export default App;
